CREATE TABLE prices(
   ticker      VARCHAR(3) NOT NULL
  ,market_date DATE  NOT NULL
  ,price       NUMERIC(20,2) NOT NULL
  ,open        NUMERIC(20,2) NOT NULL
  ,high        NUMERIC(20,2) NOT NULL
  ,low         NUMERIC(20,2) NOT NULL
  ,volume      VARCHAR(20) NOT NULL
  ,change      VARCHAR(20) NOT NULL
  ,PRIMARY KEY(ticker,market_date)
);

CREATE TABLE transactions(
   txn_id         INTEGER  NOT NULL PRIMARY KEY 
  ,member_id      VARCHAR(20) NOT NULL
  ,ticker         VARCHAR(20) NOT NULL
  ,txn_date       DATE  NOT NULL
  ,txn_type       VARCHAR(20) NOT NULL
  ,quantity       NUMERIC(20,9) NOT NULL
  ,percentage_fee NUMERIC(20,2) NOT NULL
);

CREATE TABLE members(
   member_id  VARCHAR(6) NOT NULL PRIMARY KEY
  ,first_name VARCHAR(7) NOT NULL
  ,region     VARCHAR(13) NOT NULL
);

SELECT * FROM members LIMIT 6;
SELECT * FROM Prices LIMIT 6;
SELECT * FROM transactions LIMIT 6;


--Sort all the rows in the table by first_name in alpha order and show the top 3
SELECT * FROM members order by First_Name LIMIT 3 ;

--Which record from trading.members are from the US Region
Select * from Members where region = 'United States';

--Select only the memberid and first name for members who are not from aus
Select Member_id , First_Name from Members where region != 'Australia';

--Return the unique region value from the trading.member table and sort the output by reverse alpha order
Select distinct region from members order by region desc;

--How many mentors are there in per region ?Sort the output by region with the most mentors to the least
Select region, count(member_id) as mentor_count from members group by region order by count(member_id) desc;

--How many US mentors and non mentor are there 
Select (Case When region != 'United States' then 'NoN US' ELSE 
region END) as mentor_region, count(*) as mentor_count from members group by mentor_region order by mentor_count desc;

--How many total records do we have in the price table 
Select count(ticker) from prices;

--How many records are there per ticker value ?
Select ticker, count(*) as count from prices group by ticker;

--What is the min and max market date value ?
Select ticker , min(Market_date) as mindate,max(market_date) as maxdate from prices group by ticker;

-- what is the monthly avg of the price column for eth in 2007? sort the output in chronological order and also round the avg price value upto 2 decimal
SELECT 
    EXTRACT(MONTH FROM market_date) AS month, 
    ROUND(AVG(price), 2) AS avg 
FROM 
    prices 
WHERE 
    EXTRACT(YEAR FROM market_date) = 2020 
    AND ticker = 'ETH' 
GROUP BY 
    EXTRACT(MONTH FROM market_date) 
ORDER BY 
    EXTRACT(MONTH FROM market_date);
	
-- Are there any duplicate market_date value for any ticker value in our table ?
Select ticker, count(market_date) as Total , count(distinct market_date) as unique from prices group by ticker;

--How many days from the price table exists where the high price of Bitcoin is over $20000
Select count(*) as rowcount from prices where ticker ='BTC' and high>20000;

--How many breakout days were there in 2020 where the price coloumn is greater than the open coloumn for each ticker?
Select ticker ,SUM(Case when price>open then 1 else 0 end) as breakout from prices where extract(year from market_date) = '2020'
group by ticker;

--How many non-breakout days were there in 2020 where the price coloumn is less than the open coloumn for each ticker?
Select ticker ,SUM(Case when price<open then 1 else 0 end) as nonbreakout from prices where extract(year from market_date) = '2020'
group by ticker;

--What percentage of days in 2020 were breakout days vs non breakoutdays ? round upto 2 decimal
SELECT ticker,
    ROUND((SUM(CASE WHEN price > open THEN 1 ELSE 0 END) * 100.0 / COUNT(*)), 2) AS breakout_percentage,
    ROUND((SUM(CASE WHEN price <= open THEN 1 ELSE 0 END) * 100.0 / COUNT(*)), 2) AS non_breakout_percentage
FROM 
    prices 
WHERE 
    EXTRACT(YEAR FROM market_date) = 2020 group by ticker;
	
--How many buy  and sell transaction are there for bitcoin ?
Select txn_type, count(*) as Transaction from transactions where ticker = 'BTC' group by txn_type;

--which member have sold less than 500 bitcoin ? sold from the most btc sold to least
With cte as (
Select member_id,
sum(quantity) as btc_sold
	from transactions
	where ticker = 'BTC'
	and txn_type = 'SELL'
	GROUP BY Member_id
)
Select * from cte 
where btc_sold <500
order by btc_sold desc;

--which member_id has the highest buy to sell ratio by quantity ?
SELECT 
    member_id, 
    SUM(CASE WHEN txn_type = 'BUY' THEN 1 ELSE 0 END) / 
    SUM(CASE WHEN txn_type = 'SELL' THEN 1 ELSE 0 END) AS ratio 
FROM 
    transactions 
GROUP BY 
    member_id 
ORDER BY 
    ratio DESC;
	
--which top 3 mentor have the most bitcoin quantity as of the end of the period
Select members.first_name, 
sum(
	Case 
	when transactions.txn_type = 'BUY' then transactions.quantity
    when transactions.txn_type = 'BUY' then transactions.quantity
	end
) as total from transactions INNER JOIN members on transactions.member_id = members.member_id
where ticker = 'BTC' 
group by members.first_name limit 3;


